import React, { useState } from 'react';
import Home from "./Home";
import About from "./About";
import "../css/Main.css";
import gravity from "../img/gravity.webp";
import mhw from "../img/モンハン.webp";
import cs2 from "../img/cs2.webp";
import gold from "../img/gold.png";
import silver from "../img/silver.png";
import bronze from "../img/bronze.png";

function Main() {
    const [currentPage, setCurrentPage] = useState("");

    const renderPage = () => {
        switch(currentPage){
            case "home":
                return <Home />;
            case "about":
                return <About />;
            default:
                return<>
                        <div className="imgs">
                            <img className="gravity" src={gravity} alt="cat" onClick={() => setCurrentPage("home")}></img>
                            <img className='cs2' src={cs2} alt="cs2"></img>
                            <img className="mhw" src={mhw} alt="mhw"></img>
                        </div>
                        <div className="names">
                            <h2 className='gravity'>Gravity Daze</h2><br/>
                            <h2 className='cs2'>Counter Strike</h2>
                            <h2 className='mhw'>MonsterHunter WORLD</h2>
                        </div>
                        <div>
                            <Catch />
                        </div>
                        <button onClick={() => setCurrentPage("home")}>ホーム</button>
                        <button onClick={() => setCurrentPage("about")}>アバウト</button>
                </>
        }
    };

    return (
        <>
            {renderPage()}
        </>
    );
}

const DefaultPage = () => {
    return(
        <div className='wrapper'>
            <h1 className='h'>TOP 3 Games</h1>
            <div className='crown'>
                <img className='bronze' src={bronze} alt='bronze'></img>
                <img className='gold' src={gold} alt='gold'></img>
                <img className='silver' src={silver} alt='silver'></img>
            </div>
        </div>
    );
}

function Catch()
{
    return(
        <h3>kadldjfa</h3>
    );
}

export default Main;
